import React, { useState } from 'react';
import Home from './pages/Home';
import Categories from './pages/Categories';
import { Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
const Nav = () => {
  const navigate = useNavigate();

  function handleClick(event) {

    navigate('./categories');
  }
  const[page,setPage]=useState("Home")
  function handleCkickHome(event){
    navigate('./home');
  }
  return (
    <>
      <div className='container-fluid mainNav'>
          <span className='logo' onClick={handleCkickHome}>Logo</span>

          <ul className='pages'>
            <li className='page categorie-Page' onClick={handleClick}>Categories</li>
            <li className='page product-page'>Product Page</li>
            <li className='page'><i className="fa-solid fa-cart-shopping"></i></li>
          </ul>
      </div>
      <Link to="/Categories">Categories</Link>

    </>
  )
}
export default Nav;
